import { useHistory, useParams } from "react-router-dom";
import '../../Css/GroupItem.css';
import groupItem_image from '../../img/groupItem_image.jpg';
import groupItem_image14 from '../../img/groupitem_image14.PNG';
import groupItem_image12 from '../../img/groupitem_image11.jpg';
import groupItem_image13 from '../../img/groupitem_image12.jpg';
import groupItem_image11 from '../../img/groupitem_image13.png';
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function GroupItemDetail(props) {

    let { id } = useParams();

    const photos = [groupItem_image11, groupItem_image12,groupItem_image13, groupItem_image14]

    const [groupItem, setGroupItem] = useState("");

    useEffect(()=>{
        axios.get("/groupItem/detail/"+id).then((response)=>{
            if(response.data){
                console.log(response.data);
                setGroupItem(response.data);
            }else{
                alert("failed to");
            }
        });
    }, []);


    return (
        <div>
            <h1 id="groupItem_header">구호물품 공동구매</h1>
            <div id="groupItem_main">
                <div id="groupItem_view">
                    <div id="groupItem_view_header">
                        <div id="donation_list">
                        <img className="groupItem_image" src={photos[id-10]}></img>
                           <h1>{groupItem.groupItem_name}</h1>
                           <h1>{groupItem.groupItem_price}</h1>
                           <h1>{groupItem.groupItem_detail}</h1>
                           <h1>{groupItem.groupItem_rate}</h1>
                        </div>
                    </div>
                 
                </div>
            </div>
        </div>
      );

  
}

export default GroupItemDetail;
